import React from 'react';
import Container from 'react-bootstrap/Container';
import Jumbotron from 'react-bootstrap/Jumbotron';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import '../Styles/Home.css';
const Home = () => (




  <Container className="homeContainer" fluid = {true}>
  <link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Open+Sans|Rancho|Permanent+Marker&display=swap" rel="stylesheet"></link>
  <h1 className="homeText"> I am <span>Karishma</span> , </h1>
    <h5 className="homeText"> a Front-End Developer based in New York</h5>



  </Container>


)

export default Home;
